import React, { useState, useRef, useEffect } from "react";

// import Avatar1 from "../pages/assets/amanda-jones-e3jKBZoRnTs-unsplash.jpg";
// import Avatar2 from "../pages/assets/chooseyou_img_1a.png";
// import Avatar3 from "../pages/assets/fatih-kgqu_qs3B78-unsplash.jpg";
// import Avatar4 from "../pages/assets/jene-stephaniuk--MCrF6hnojU-unsplash.jpg";
// import Avatar5 from "../pages/assets/katrina-wright-yMg_SMqfoRU-unsplash.jpg";
// import Avatar6 from "../pages/assets/khadeeja-yasser-FHT0KEOwtyg-unsplash.jpg";
// import Avatar7 from "../pages/assets/chooseyou_img_2.png";
// import Avatar8 from "../pages/assets/doing_my_best.jpg";
// import Avatar9 from "../pages/assets/pregnant_belly.jpg";
// import Avatar10 from "../pages/assets/happy balloons.jpg";
// import Avatar11 from "../pages/assets/painted hand.jpg";
import { ReactComponent as Logo } from "./assets/chooseyou-mission-img.svg";
import classes from "./MissionStatement.module.css";
import { motion, AnimatePresence } from "framer-motion";
// import PageContent from "../components/PageContent";

function MissionStatement() {
  const [showAboutModal, setShowAboutModal] = useState(false);

  const modalSetting = () => {
    setShowAboutModal(!showAboutModal);

    if (showAboutModal == false) {
      showOverlay();
    } else {
      removeOverlay();
    }
  };

  function showOverlay() {
    const mainEl = document.querySelector("html");
    mainEl.style.overflow = "hidden";
  }

  function removeOverlay() {
    const mainEl = document.querySelector("html");
    mainEl.style.overflow = "auto";
  }
  const transition_text = {
    duration: 0.33,
    ease: "easeInOut",
  };
  return (
    <motion.div className={classes.main}>
      <AnimatePresence>
        {showAboutModal && (
          <motion.div>
            <motion.div className={classes.aboutMeModalMainBackdropContainer}>
              <motion.div
                key="nav_text_2"
                initial={{ opacity: 0 }}
                animate={{ opacity: 1 }}
                transition={transition_text}
                exit={{ opacity: 0 }}
                className={classes.aboutMeModalMainBackdrop}
                onClick={modalSetting}
              ></motion.div>
              <motion.div
                key="nav_text_2"
                initial={{ opacity: 0 }}
                animate={{ opacity: 1 }}
                transition={transition_text}
                exit={{ opacity: 0 }}
                className={classes.aboutMeModalMain}
              >
                <motion.div className={classes.aboutMeModalHeader}>
                  About Me
                </motion.div>
                <motion.div className={classes.aboutMeModalBody}>
                  <motion.div className={classes.aboutHeader2}>
                    My Story
                  </motion.div>
                  <motion.div
                    className={`${classes.aboutMeModalP} ${classes.aboutMeModalP1}`}
                  >
                    As a kid and young adult, I grappled with feelings of
                    inadequacy and never feeling "good enough." My background in
                    professional dance exposed me to constant judgment and
                    scrutiny, adding to my struggles. Seeking clarity and
                    purpose, I made the bold decision to move across the country
                    in search of self-discovery.
                  </motion.div>
                  <motion.div
                    className={`${classes.aboutMeModalP} ${classes.aboutMeModalP1}`}
                  >
                    It was during this transformative period that yoga found me,
                    or perhaps I found yoga. The profound connection between
                    breath, movement, and heart unlocked something within me
                    that I felt compelled to share with the world. Alongside my
                    journey with yoga, I found love and started a family with my
                    high school sweetheart. Now, blessed with a fierce and
                    confident daughter and another baby on the way, my role as a
                    mother brings me immense fulfillment.
                  </motion.div>
                  <motion.div className={classes.aboutHeader2}>
                    Embracing Change and Growth
                  </motion.div>
                  <motion.div
                    className={`${classes.aboutMeModalP} ${classes.aboutMeModalP2}`}
                  >
                    Despite the joy of motherhood, I felt a longing for personal
                    fulfillment beyond my roles as a wife and mother. Watching
                    an episode of "Parenthood" triggered a pivotal moment of
                    self-reflection, prompting me to explore avenues that would
                    allow me to continue choosing myself. Driven by a passion
                    for asking questions and identifying strengths, I embarked
                    on a journey into coaching. Inspired by the lessons learned
                    on the yoga mat, I enrolled in a rigorous coach training
                    program, eager to expand my impact beyond the confines of
                    the corporate world.
                  </motion.div>
                  <motion.div className={classes.aboutHeader2}>
                    A Work in Progress
                  </motion.div>
                  <motion.div
                    className={`${classes.aboutMeModalP} ${classes.aboutMeModalP2}`}
                  >
                    While my journey may not have followed the traditional path
                    I envisioned, it's a testament to the power of embracing
                    change and driving towards one's dreams. Founding this
                    coaching business and embracing the joys of motherhood have
                    illuminated the path towards my true purpose.
                  </motion.div>
                  <motion.div
                    className={`${classes.aboutMeModalP} ${classes.aboutMeModalP2}`}
                  >
                    As our family grows and my coaching business flourishes, one
                    principle remains constant: positive energy. It fuels my
                    journey, guiding me towards a future where I continue to
                    inspire and empower others to embrace their authenticity and
                    choose themselves consistently.
                  </motion.div>
                  <motion.div
                    className={`${classes.aboutMeModalP} ${classes.aboutMeModalP3}`}
                  >
                    I always thought I would be the CEO of a corporation and
                    become a mom with a large family. Can I say this happened?
                    Sort of! It’s a work in progress, and I drive this dream. I
                    founded this coaching business, and adore being a mom.
                    Seeing my daughter explore daily has opened a side of me
                    that reminds me of how I choose myself. As our family
                    expands and as my coaching business develops, they have one
                    thing in common…. Positive Energy!
                  </motion.div>
                </motion.div>
              </motion.div>
            </motion.div>
          </motion.div>
        )}
      </AnimatePresence>

      <motion.div
        id="body"
        className={`${classes.homeBody} ${
          showAboutModal && classes.homeBodyModal
        }`}
      >
        <motion.section
          className={`${classes.sectionContainer} ${classes.sectionContainer_1}`}
        >
          <motion.div
            className={`${classes.infoSectionContainer} ${classes.infoSectionContainer_1}`}
          >
            <motion.div
              className={`${classes.infoSectionImgContainer} ${classes.infoSectionImgContainer_1}`}
            >
              <motion.img
                className={`${classes.img_1} ${classes.img_1_1}`}
                src={Avatar3}
              />
              <motion.div
                className={`${classes.img2Container} ${classes.img2Container_1}`}
              >
                <motion.img
                  className={`${classes.img_2} ${classes.img_2_1}`}
                  src={Avatar2}
                />
              </motion.div>
            </motion.div>
            <motion.div
              className={`${classes.infoSectionTextContainer} ${classes.infoSectionTextContainer_1}`}
            >
              <motion.div
                className={`${classes.infoSectionHeaderContainer} ${classes.infoSectionHeaderContainer_1}`}
              >
                <motion.h1
                  className={`${classes.infoSectionHeader} ${classes.infoSectionHeader_1}`}
                >
                  Choose you for a fulfilling and thriving life!
                </motion.h1>
              </motion.div>
              <motion.div
                className={`${classes.headerLineBreak} ${classes.headerLineBreak_1}`}
              />
              <motion.div
                className={`${classes.infoSectionParagraphContainer} ${classes.infoSectionParagraphContainer_1}`}
              >
                <motion.div
                  className={`${classes.infoSectionParagraph} ${classes.infoSectionParagraph_1}`}
                >
                  <motion.div
                    className={`${classes.infoSectionParagraph1} ${classes.infoSectionParagraph1_1}`}
                  >
                    My name is Christie Cianciulli and I am the founder of
                    Choose You Coaching.
                  </motion.div>
                  <motion.div
                    className={`${classes.infoSectionParagraph2} ${classes.infoSectionParagraph2_1}`}
                  >
                    As a positivity coach, I specialize in helping individuals
                    navigate life transitions and achieve personal growth.
                    Whether you're a dedicated mother, embarking on a new career
                    path, or striving for personal development, I am here to be
                    your partner and guide you toward impactful change.
                  </motion.div>
                </motion.div>
              </motion.div>
            </motion.div>
          </motion.div>
        </motion.section>
        <motion.section
          className={`${classes.sectionContainer} ${classes.sectionContainer_2}`}
        >
          <motion.div
            className={`${classes.infoSectionContainer} ${classes.infoSectionContainer_2}`}
          >
            <motion.div
              className={`${classes.infoSectionImgContainer} ${classes.infoSectionImgContainer_2}`}
            >
              <motion.img
                className={`${classes.img_1} ${classes.img_1_2}`}
                src={Avatar7}
              />
              {/* <div
              className={`${classes.img2Container} ${classes.img2Container_2}`}
            >
              <img
                className={`${classes.img_2} ${classes.img_2_2}`}
                src={Avatar8}
              />
            </div> */}
            </motion.div>
            <motion.div
              className={`${classes.infoSectionTextContainer} ${classes.infoSectionTextContainer_2}`}
            >
              <motion.div
                className={`${classes.infoSectionHeaderContainer} ${classes.infoSectionHeaderContainer_2}`}
              >
                <motion.h1
                  className={`${classes.infoSectionHeader} ${classes.infoSectionHeader_2}`}
                >
                  About Me!
                </motion.h1>
              </motion.div>
              <motion.div
                className={`${classes.headerLineBreak} ${classes.headerLineBreak_2}`}
              />
              <motion.div
                className={`${classes.infoSectionParagraphContainer} ${classes.infoSectionParagraphContainer_2}`}
              >
                <motion.div
                  className={`${classes.infoSectionParagraph} ${classes.infoSectionParagraph_2}`}
                >
                  <motion.p
                    className={`${classes.infoSectionParagraph1} ${classes.infoSectionParagraph1_2}`}
                  >
                    As a kid and young adult, I grappled with feelings of
                    inadequacy and never feeling "good enough." My background in
                    professional dance exposed me to constant judgment and
                    scrutiny, adding to my struggles. Seeking clarity and
                    purpose, I made the bold decision to move across the country
                    in search of self-discovery. It was during this
                    transformative period that yoga found me, or perhaps I found
                    yoga. The profound connection between breath, movement, and
                    heart unlocked something within me...
                  </motion.p>
                </motion.div>
              </motion.div>
              <motion.div className={classes.buttonAboutContainer}>
                <motion.button
                  className={classes.buttonAbout}
                  onClick={modalSetting}
                >
                  Read more about me!
                </motion.button>
              </motion.div>
            </motion.div>
          </motion.div>
        </motion.section>
        <motion.section
          className={`${classes.sectionContainer} ${classes.sectionContainer_3}`}
        >
          <motion.div
            className={`${classes.infoSectionContainer} ${classes.infoSectionContainer_3}`}
          >
            <motion.div
              className={`${classes.infoSectionTextContainer} ${classes.infoSectionTextContainer_3}`}
            >
              <motion.div
                className={`${classes.infoSectionHeaderContainer} ${classes.infoSectionHeaderContainer_3}`}
              >
                <motion.h1
                  className={`${classes.infoSectionHeader} ${classes.infoSectionHeader_3}`}
                >
                  Mission + Philosophy
                </motion.h1>
              </motion.div>
              <motion.div
                className={`${classes.headerLineBreak} ${classes.headerLineBreak_3}`}
              />
              <motion.div
                className={`${classes.infoSectionParagraphContainer} ${classes.infoSectionParagraphContainer_3}`}
              >
                <motion.div
                  className={`${classes.infoSectionParagraph} ${classes.infoSectionParagraph_3}`}
                >
                  <motion.div
                    className={`${classes.infoSectionParagraph2} ${classes.infoSectionParagraph2_3A}`}
                  >
                    My mission is to develop partnerships to support future
                    goals with small steps to prioritize the authentic positive
                    light inside of you.
                  </motion.div>
                  <motion.div
                    className={`${classes.infoSectionParagraph2} ${classes.infoSectionParagraph2_3B}`}
                  >
                    How we do this together?
                  </motion.div>
                  <motion.div
                    className={`${classes.infoSectionParagraph2} ${classes.infoSectionParagraph2_3C}`}
                  >
                    I use positive psychology techniques and inquiry to explore
                    a child-like curiosity in you that allows you to choose
                    yourself consistently!
                  </motion.div>
                </motion.div>
              </motion.div>
            </motion.div>
          </motion.div>
        </motion.section>
        <motion.section className={classes.sectionValuesContainer}>
          <div
            className={`${classes.valuesSectionContainer} ${classes.valuesSectionContainer_1}`}
          >
            <div
              className={`${classes.valuesHeaderMain} ${classes.valuesHeaderMain_1}`}
            >
              ChooseYOU Values
            </div>
            <div
              className={`${classes.valuesSectionValueContainer} ${classes.valuesSectionValueContainer_1}`}
            >
              <motion.div
                className={`${classes.imgValuesContainer} ${classes.imgValuesContainer_1}`}
              >
                <motion.img
                  className={`${classes.imgValues} ${classes.imgValues_1}`}
                  src={Avatar8}
                />
              </motion.div>
              <div
                className={`${classes.valuesHeaderContainer} ${classes.valuesHeaderContainer_1}`}
              >
                <h3
                  className={`${classes.valuesHeader} ${classes.valuesHeader_1}`}
                >
                  Optimism
                </h3>
              </div>
              <div
                className={`${classes.valuesParagraphContainer} ${classes.valuesParagraphContainer_1}`}
              >
                <div
                  className={`${classes.valuesParagraph} ${classes.valuesParagraph_1}`}
                >
                  Willing to explore something new each time we come together
                </div>
              </div>
            </div>
            <div
              className={`${classes.valuesSectionValueContainer} ${classes.valuesSectionValueContainer_1}`}
            >
              <motion.div
                className={`${classes.imgValuesContainer} ${classes.imgValuesContainer_1}`}
              >
                <motion.img
                  className={`${classes.imgValues} ${classes.imgValues_1}`}
                  src={Avatar10}
                />
              </motion.div>
              <div
                className={`${classes.valuesHeaderContainer} ${classes.valuesHeaderContainer_1}`}
              >
                <h3
                  className={`${classes.valuesHeader} ${classes.valuesHeader_1}`}
                >
                  Love
                </h3>
              </div>
              <div
                className={`${classes.valuesParagraphContainer} ${classes.valuesParagraphContainer_1}`}
              >
                <div
                  className={`${classes.valuesParagraph} ${classes.valuesParagraph_1}`}
                >
                  Giving yourself grace and everything that enters into your
                  life is here to teach you something new
                </div>
              </div>
            </div>
            <div
              className={`${classes.valuesSectionValueContainer} ${classes.valuesSectionValueContainer_1}`}
            >
              <motion.div
                className={`${classes.imgValuesContainer} ${classes.imgValuesContainer_1}`}
              >
                <motion.img
                  className={`${classes.imgValues} ${classes.imgValues_1}`}
                  src={Avatar11}
                />
              </motion.div>
              <div
                className={`${classes.valuesHeaderContainer} ${classes.valuesHeaderContainer_1}`}
              >
                <h3
                  className={`${classes.valuesHeader} ${classes.valuesHeader_1}`}
                >
                  Equality
                </h3>
              </div>
              <div
                className={`${classes.valuesParagraphContainer} ${classes.valuesParagraphContainer_1}`}
              >
                <div
                  className={`${classes.valuesParagraph} ${classes.valuesParagraph_1}`}
                >
                  We are equals creating this trusted partnership side by side
                  to create the life you want to live
                </div>
              </div>
            </div>
            <div></div>
            <div></div>
          </div>
        </motion.section>
      </motion.div>
    </motion.div>
  );
}

export default MissionStatement;
